import React from 'react';
import { useField } from '../../../hooks/useField';

const NormalLogin = () => {
  const email = useField('text');
  const password = useField('text');

  return (
    <form>
      <input
        placeholder="email"
        {...email}
        reset={undefined}
      />
      <input
        placeholder="password"
        {...password}
        reset={undefined}
      />
      <button type="button">
        Log In
      </button>
    </form>
  );
};

export default NormalLogin;
